lors[j]);\n                        col[i-1] = colors[j];\n                        j++;\n                    }else{col.push(\"#999999\");}\n                }\n                source.data.color = col;\n            }\n            if(b ===2){ //Nans\n                var temp = 0\n                max = Math.max(...data.nans)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * (1 - ((data.nans[i] + 1) / 19)));\n                    col.push(fullColorHex(temp, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"00928e54-c180-4a54-9b09-5333595bdf07","type":"CustomJS"},{"attributes":{"dimension":1,"plot":{"id":"8103f11f-a4da-4f13-a4d5-e8e64e5bfba0","subtype":"Figure","type":"Plot"},"ticker":{"id":"e7db7507-00a2-4d5a-8223-ba38c10219f0","type":"BasicTicker"}},"id":"b86a8fd7-d37f-4b38-a19a-392f91f17fdc","type":"Grid"},{"attributes":{},"id":"126f3420-b6ee-4e24-89fc-04b1b2dc7337","type":"ResetTool"},{"attributes":{"children":[{"id":"902e4b20-5a4c-403e-8521-565402264d9f","type":"RadioButtonGroup"}]},"id":"48d2f60c-9fb1-4d2f-a4e1-c435eff57080","type":"WidgetBox"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#1f77b4"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":10},"x":{"field":"x"},"y":{"field":"y"}},"id":"a397e6c9-9739-4600-9c7b-807c74a35f8f","type":"Circle"},{"attributes":{},"id":"79f486aa-966e-4679-b7fa-afd2838fab97","type":"LinearScale"},{"attributes":{"callback":null,"column_names
